import React, { useEffect, useState } from 'react';
import './App.css';
import MovieRow  from './Components/MovieRow/MovieRow';
import requests from './Constants/Requests';


function App() {

  return (
    <div className="App">
        <div style={{
            background: "rgba(29, 29, 35, 1)",
          }}>
        <MovieRow backdrop fetchUrl={requests.fetchPopular.url} category="Trending"/>

          <div style={{
            background: "rgba(29, 29, 35, 1)",
            position: "relative",
            bottom: '5rem',
          }}>

            {
              Object.keys(requests).map((req, id) => {
                return (
                  <div>
                    <MovieRow className="movie-row" key={id} fetchUrl={requests[req].url} category={requests[req].name}/>
                  </div>
                )
              })
            }

          </div>




        </div>

    </div>
  );
}

export default App;
